import './App.css';
import { BrowserRouter, Route,Routes } from 'react-router-dom';
import Home from './pages/home/home';
import Blog from './pages/blog/blog';


function App() {
  return (
  <>
      <BrowserRouter>
          <Routes>
            <Route path='/home' element={<Home/>} />
            <Route path='/blog' element={<About/>} />
          </Routes>
      </BrowserRouter>
  </>
  );
}

export default App;
